import React from 'react';
import {BrowserRouter as Router, Route, Routes, NavLink} from 'react-router-dom'

export default function Flip() {
    return (
        <div className="flip-menu">
            <Router>
                <NavLink to="/2"><img src="./images/mini/next1.svg" alt="Картинка ушла за хлебом" /></NavLink>
                <Routes>
                    <Route path='/' element={<span>1/3</span>}/>
                    <Route path='/2' element={<span>2/3</span>}/>
                </Routes>
                <NavLink to="/"><img src="./images/mini/next2.svg" alt="Картинка ушла за хлебом" /></NavLink>
            </Router>
            
        </div>
    )
}
